function Post() {

    useEffect(() => {


        const fetchPosts = async () => {

            try {

                const config = {
                    headers: {
                        'Content-Type': 'application/json',
                        'auth-token': localStorage.getItem('token')
                    }
                }

                const res = await axios.get('http://localhost:5000/post', config)
                console.log(res)

            } catch (error) {

            }

        }

        fetchPosts()

    }, [])

    return(
        <MDBCol className="post pr-2 pb-4 mt-5" lg="7">
            <AddIcon className="mx-5" style={{ fontSize: "50" }}/>
            <PostItem />
            <PostItem />
            <PostItem />
            <PostItem />
            <PostItem />
            <PostItem />
            <PostItem />
        </MDBCol>
    )
}

export default Post
